    private static class Solution {
        public int lengthOfLongestSubstring(String s) {
            if (s == null || s.length() == 0)
                return 0;
            
            int largestLength = 1;
            int i = 0;
            Set<Character> seen = new HashSet<>();
            while (i < s.length()) {
                int j = 0;
                
                while (i+j < s.length() && !seen.contains(s.charAt(i+j))) {
                    seen.add(s.charAt(i+j));
                    j++;
                }
                if (seen.size() > largestLength)
                    largestLength = seen.size();
                
                i++;
                seen.clear();
            }
            
            return largestLength;
        }
        
    }
    
